import React from 'react';
import './App.css';
import Header from './components/HeaderDir/Header';
import MainGame from './components/MainGameDir/MainGame';
// import Sidebar from './components/SidebarDir/Sidebar';

function App() {
  return (
    <>
      <title>Epic7dle</title>
      <div className="App">
        <Header />
        <div className="maingame-container" style={{ background: `url(${'background1.webp'}) no-repeat center`, paddingTop: '20%', backgroundSize: 'cover' }}>
          <MainGame />
        </div>
      </div>
    </>
  );
}

export default App;
